B.My=A.a(s(["Ist der Abstand zwischen den beiden Atomen hinreichend gro\xdf, so stehen diese nicht miteinander in Wechselwirkung. Die m\xf6glichen Energiewerte, die die beiden Atome annehmen k\xf6nnen, liegen auf der gleichen H\xf6he wie bei einem einzelnen Atom.","Bringt man die beiden Atome n\xe4her zusammen, so \xfcberlappen sich die Elektronenbahnen und beide Atome treten miteinander in Wechselwirkung. Dies bewirkt - \xe4hnlich wie bei gekoppelten Resonatoren - eine Aufspaltung der m\xf6glichen Energieniveaus, die um so st\xe4rker ist, je gr\xf6\xdfer die Kopplung, d.h. je geringer der Abstand zwischen den beiden Atomen ist."]),t.i)
B.D0=new A.eD("Das Applet zeigt die Auswirkungen auf die m\xf6glichen Energiezust\xe4nde W zweier einzelner Atome, wenn diese miteinander in Wechselwirkung gebracht werden, indem man den Abstand zwischen ihnen verringert.\n\nMan sieht:\n",B.My,null)
B.N8=A.a(s(["F\xfcr UBE=0V und UCE=5V ist sowohl der Basis-Kollektor \xdcbergang als auch der Basis-Emitter \xdcbergang in Sperrrichtung gepolt, so dass kein Strom durch den Transistor flie\xdft, d.h. IE=IC=0.","Erh\xf6ht man die Basis-Emitter Spannung auf etwa UBE=0,7V, so wird der Basis-Emitter \xdcbergang in Durchlassrichtung gepolt. Dies f\xfchrt (vgl. Diode) zum einen dazu, dass L\xf6cher vom p-Gebiet (der Basis) in das n-Gebiet (den Emitter) diffundieren und dort rekombinieren. Zum anderen diffundieren Elektronen umgekehrt von dem n-Gebiet in die Basis. Da die Basisweite jedoch sehr klein ist, rekombinieren die Elektronen dort nicht, sondern gelangen bis in den n-dotierten Kollektor. Die angelegte Basis-Emitter Spannung f\xfchrt somit zu einem Elektronenstrom vom Emitter durch das Basisgebiet bis hin zum Kollektor."]),t.i)
B.D1=new A.eD("Dieses Applet veranschaulicht die Funktion des Bipolartransistors.\n\nMan sieht:\n",B.N8,null)
B.LR=A.a(s(["Bei einem einzigen Atom (n=1) erh\xe4lt man zwei m\xf6gliche Energiezust\xe4nde, von denen der untere besetzt ist.","Bei zwei Atomen (n=2) spalten sich die Energiezust\xe4nde wegen der Kopplung zwischen den beiden Atomen auf.","Erh\xf6ht man die Anzahl der Atome weiter, so spalten sich die Energieniveaus immer weiter auf, bis diese bei einer sehr gro\xdfen Anzahl von Atomen (hier n=16) so dicht beieinander liegen, dass man nicht mehr von Energielinien sondern von Energieb\xe4ndern spricht.","Da in diesem Beispiel eine sehr niedrige Umgebungstemperatur angenommen wurde, befinden sich alle Elektronen in dem jeweils niedrigsten Energiezustand, d.h. in dem unteren Energieband. Das obere Energieband ist unter diesen Bedingungen vollst\xe4ndig unbesetzt."]),t.i)
B.D2=new A.eD("Dieses Applet illustriert den \xdcbergang von einem einzelnen Atom zu einem Kristall mit einer sehr gro\xdfen Zahl von regelm\xe4\xdfig angeordneten Atomen, wobei der Abstand der Atome untereinander so gering ist, dass die Atome miteinander in Wechselwirkung stehen. Die Umgebungstemperatur sei in dem Beispiel sehr niedrig, so dass jeweils die untersten Energiezust\xe4nde besetzt sind.\n\nMan sieht:\n",B.LR,null)
B.NG=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Bor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (dreiwertige) B-Atome, so gehen jeweils die drei Elektronen des Bor-Atoms (B) eine Bindung mit den benachbarten Si-Atomen ein.","Da bei dem Boratom ein Elektron zur Bindung fehlt, existiert an dieser Stelle eine L\xfccke, die zun\xe4chst noch an das Boratom gebunden ist. Es gen\xfcgt jedoch bereits eine sehr geringe Energiezufuhr (z.B. geringe Temperaturerh\xf6hung), damit sich ein vorher im Kristallgitter gebundenes Valenzelektron in diese L\xfccke setzt, d.h. an das Boratom (den so genannten Akzeptor) bindet. Dadurch entsteht an der Stelle, an der vorher das Valenzelektron sa\xdf, ein freies Loch, in das wiederum ein anderes Elektron springen kann. Die geringe Ionisierungsenergie des Boratoms entspricht im B\xe4nderdiagramm dem geringen Abstand des Energieniveaus des Akzeptors Wa zum Valenzband Wv.","Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (hier: 100K) alle Boratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien L\xf6cher po gleich der Dichte NA der Dotierungsatome ist.","Der negative Atomrumpf (B-) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Es erh\xf6ht sich demnach nur die Anzahl der freien L\xf6cher, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Bor dotierten Halbleiter die freien L\xf6cher ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem p-Typ Halbleiter."]),t.i)
B.D3=new A.eD("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Bor) die Anzahl der freien L\xf6cher erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.NG,null)
B.LJ=A.a(s(["Bei niedrigen Temperaturen (hier: 300K) ist das Atom in einem energetisch niedrigen Zustand. In dem dargestellten Atommodell befindet sich das Elektron auf der inneren Schale.","Durch Erh\xf6hen der Temperatur gelangt das Elektron auf eine weiter au\xdfen liegende Schale. Dies entspricht einem angeregten Energiezustand.","Tr\xe4gt man die m\xf6glichen Energiewerte W, die das Atom annehmen kann, in einem einfachen Diagramm auf, so ergeben sich mehrere diskrete Zust\xe4nde (Energielinien), deren Anzahl und Abst\xe4nde f\xfcr das Atom charakteristisch ist."]),t.i)
B.D4=new A.eD("Atome k\xf6nnen unterschiedliche Energiezust\xe4nde annehmen. Dieses Applet zeigt in einer stark vereinfachten Darstellung einen Atomkern (rot) mit einem Valenzelektron (blau), welches durch Zuf\xfchren von W\xe4rmeenergie angeregt wird.\n\nMan sieht:\n",B.LJ,null)
B.Nz=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Phosphor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (f\xfcnfwertige) P-Atome, so gehen jeweils vier der f\xfcnf Elektronen des Phosphor-Atoms (P) eine Bindung mit den benachbarten Si-Atomen ein; das f\xfcnfte Elektron bleibt jedoch ungebunden.",'Dieses f\xfcnfte Elektron, das keine Bindung eingegangen ist, kann bereits durch Zuf\xfchren geringer Ionisierungsenergie (z.B. geringe Temperaturerh\xf6hung) von dem Phosphor-Atom (P), dem so genannten Donator, gel\xf6st werden und wird dann zu einem "freien" Elektron. In dem B\xe4nderdiagramm entspricht diese geringe Ionisierungsenergie dem geringen Abstand des Donatorniveaus Wd zum Leitungsband Wc.',"Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (150K) alle Phosphoratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien Elektronen no gleich der Dichte ND der Dotierungsatome ist.","Der positive Atomrumpf (P+) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Durch das Dotieren erh\xf6ht sich demnach nur die Anzahl der freien Elektronen, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Wird die Temperatur weiter erh\xf6ht (T>300K) l\xf6sen sich - wie auch beim undotierten Halbleiter - immer mehr Bindungen zwischen den Si-Atomen und es entstehen zus\xe4tzliche Elektronen-Loch-Paare.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes, ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Phosphor dotierten Halbleiter die freien Elektronen ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem n-Typ Halbleiter."]),t.i)
B.D5=new A.eD("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Phosphor) die Anzahl der zum Stromtransport wichtigen freien Elektronen erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.Nz,null)
B.NL=A.a(s(["Bei sehr niedrigen Temperaturen sind alle Bindungen im Halbleiterkristall intakt. Es sind keine freien Elektronen vorhanden, die zum Stromtransport beitragen k\xf6nnen. In der B\xe4nderdiagrammdarstellung bedeutet dies, dass sich alle Elektronen im so genannten Valenzband befinden; das obere Energieband (Leitungsband) ist unbesetzt.","Wird die zum L\xf6sen einer Bindung n\xf6tige Energie (z.B. durch Erh\xf6hung der Temperatur) \xfcberschritten, entstehen freie Elektronen. Diese freien Elektronen befinden sich in der B\xe4nderdiagrammdarstellung im so genannten Leitungsband. Der Abstand von Leitungsband zu Valenzband, der Bandabstand Wg, entspricht dabei der Energie, die zugef\xfchrt werden muss, um eine Bindung zu l\xf6sen.","An den Stellen, wo vorher die jetzt freien Elektronen sa\xdfen, bleibt jeweils eine L\xfccke (ein so genanntes Loch) zur\xfcck. Diesem Loch kann - wegen der fehlenden negativen Ladung des Elektrons - eine positive Ladung zugeordnet werden. Da in diese L\xfccke wiederum andere Elektronen springen k\xf6nnen, tragen auch L\xf6cher zum Ladungstransport bei.","Durch das L\xf6sen von Bindungen zwischen Si-Atomen werden L\xf6cher und Elektronen paarweise generiert, so dass ihre Anzahl stets gleich gro\xdf ist.","Die Zahl der freien Ladungstr\xe4ger (Elektronen und L\xf6cher) in einem undotierten Halbleiter ist bei moderaten Temperaturen \xe4u\xdferst gering. Erst bei sehr hohen Temperaturen steigt die Anzahl der freien Ladungstr\xe4ger deutlich an. Durch Dotieren, d.h. den Einbau von Fremdatomen in den Halbleiter, kann jedoch die Zahl der freien L\xf6cher oder Elektronen gezielt ver\xe4ndert und bereits bei Raumtemperatur deutlich erh\xf6ht werden."]),t.i)
B.D6=new A.eD("Ein undotierter Silizium-Halbleiter besteht ausschlie\xdflich aus vierwertigen Siliziumatomen (Si), die in einer regelm\xe4\xdfigen Kristallstruktur angeordnet sind. Dabei gehen die vier Valenzelektronen eines jeden Siliziumatoms so genannte kovalente Bindungen mit den Elektronen der benachbarten Si-Atome ein. Das Applet zeigt das Verhalten eines undotierten Halbleiters bei \xc4nderung der Temperatur. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im so genannten B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.NL,null)
B.MG=A.a(s(["F\xfcr eine gegebene Spannung UBE liefert der Schnittpunkt der jeweiligen Transistorausgangskennlinie mit der Lastgeraden den Wert des Stromes IC sowie der Ausgangsspannung UCE.",u.R,"Bei gr\xf6\xdferen oder kleineren Werten von UBE0 arbeitet der Transistor entweder im S\xe4ttigungs- oder im Sperrbetrieb, so dass die Verst\xe4rkung deutlich abnimmt."]),t.i)
B.D7=new A.eD("Dieses Applet veranschaulicht die Funktion eines Verst\xe4rkers mit passiver Last.\n\nMan sieht:\n",B.MG,null)
B.ND=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T1 und T2 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T3.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes IC,A durch T2 und T3 sowie der Ausgangsspannung UCE,A im Arbeitspunkt.","Der Arbeitspunkt, d.h. der Strom IC,A durch die Transistoren T2 und T3 sowie die Spannung UCE,A am Ausgang der Schaltung l\xe4sst sich bei einer vorgegebenen Spannung UBE,A durch den Transistorparameter IS3 beeinflussen. IS3 kann dabei z.B. \xfcber die Gr\xf6\xdfe des Transistors T3 eingestellt werden.Der Strom IC,A ist dabei im Wesentlichen durch den Stromspiegel T1 und T2 eingepr\xe4gt und \xe4ndert sich daher auch bei \xc4nderungen des Transistorparameters IS3 nur sehr wenig.","Die Spannung UCE,A im Arbeitspunkt reagiert jedoch sehr empfindlich auf \xc4nderungen des Parameters IS3. Diese Empfindlichkeit wird um so gr\xf6\xdfer, je geringer der Early-Effekt ist, d.h. je gr\xf6\xdfer die Early-Spannung Uan ist."]),t.i)
B.n6=new A.eD(u.k,B.ND,null)
B.NK=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Transistors T2 des Stromspiegels.","Im aktiven Vorw\xe4rtsbetrieb, d.h. f\xfcr UBC > 0V, verl\xe4uft die Kennlinie sehr flach, so dass der Strom Io n\xe4herungsweise konstant ist.","Nimmt die Spannung Uo am Ausgang des Stromspiegels zu, vermindert sich die Spannung UBC, bis der Basis-Kollektor-\xdcbergang des Transistors T2 schlie\xdflich f\xfcr UBC < 0V in Durchlassrichtung gepolt wird. Der Transistor T2 geht dann in S\xe4ttigung und der Strom Io nimmt ab.Sind beide Transistoren gleich gro\xdf, d.h., ist IS1 = IS2, so entspricht der Strom Io im aktiven Vorw\xe4rtsbetrieb etwa dem Strom Iref durch den Referenztransistor T1.","Das Stromverh\xe4ltnis Io zu Iref kann \xfcber das Verh\xe4ltnis IS1 zu IS2 eingestellt werden, so dass sich mit dem Stromspiegel beliebige Str\xf6me generieren lassen.","Die Steigung der Kennlinie des Transistors T2 h\xe4ngt von dem Ausgangswiderstand r0 des Transistors und damit von der Early-Spannung Uan ab. Je gr\xf6\xdfer die Early-Spannung Uan ist, um so flacher verl\xe4uft die Kennlinie, d.h. um so weniger h\xe4ngt der eingestellte Strom Io von der Spannung Uo ab."]),t.i)
B.D8=new A.eD(u.k,B.NK,null)
B.NT=A.a(s(["F\xfcr die gezeigte Schaltung kann die \xdcbertragungskennlinie grafisch konstruiert werden, indem das Ausgangskennlinienfeld IC=IC(UCE,UBE) des Transistors und die Kennlinie IC(UCE) des Widerstandes in ein Diagramm eingetragen werden. F\xfcr einen gegebenen Wert von UBE ergibt dann der Schnittpunkt der entsprechenden Transistorkennlinie mit der Widerstandsgeraden den dazugeh\xf6rigen Wert f\xfcr UCE.",u.R,"Die Steigung dUCE/dUBE der \xdcbertragungskennline entspricht der Kleinsignalspannungsverst\xe4rkung Au. F\xfcr Werte UBE unter etwa 0,6V ist die Steigung und damit die Verst\xe4rkung etwa Null, da der Transistor sperrt. F\xfcr gro\xdfe Werte von UBE geht die Verst\xe4rkung ebenfalls gegen Null, da der Transistor in S\xe4ttigung geht."]),t.i)
